import React from 'react';
import './App.css';
import { Button } from '@material-ui/core'

class Test extends React.Component {
    handleClick = () => {
        console.log("Button was clicked");
    }

    render() {
        return <Button variant="contained" onClick={this.handleClick}>Click me!</Button>;
    }
}

export default Test;
